import React from "react";
import { Nav } from "react-bootstrap";

function Sidebar({ collapsed, page, setPage }) {
  const handleClick = (e, targetPage) => {
    e.preventDefault();
    setPage(targetPage);
  };

  return (
    <Nav className="flex-column p-3">
      <Nav.Link
        href="#"
        active={page === "profile"}
        onClick={(e) => handleClick(e, "profile")}
      >
        {collapsed ? "P" : "Profile"}
      </Nav.Link>
      <Nav.Link
        href="#"
        active={page === "articles"}
        onClick={(e) => handleClick(e, "articles")}
      >
        {collapsed ? "A" : "My Articles"}
      </Nav.Link>
      <Nav.Link href="#" active={false}>
        {collapsed ? "S" : "Settings"}
      </Nav.Link>
    </Nav>
  );
}

export default Sidebar;
